import {gql} from "@apollo/client"

export const GetDish = gql`
query ($slug: ID!) {
  gerechtBy(id: $slug) {
    id
    slug
    uri
    gerechtmeta {
      origin
      description
      title
      profilePicture {
        sourceUrl
        altText
      }
    }
  }
}
`
